pragma solidity =0.7.6;

import { IUniswapV3Pool } from "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "./vendor/PoolAddress.sol";
import "./UniV3Oracle.sol";
import "../interfaces/ISuOracle.sol";

/*
    * @title SuUniV3Oracle
    * @dev SuUniV3Oracle is an implementation of the SuOracle interface for UniswapV3.
*/
contract SuUniV3Oracle is UniV3Oracle, ISuOracle {
    mapping (address => address) public assetToPool;

    address public immutable Factory;
    address public immutable WETH;
    address public immutable USDT;
    address public immutable USDTPool;

    constructor(address _Factory, address _WETH, address _USDT, address _authControl) UniV3Oracle(_authControl) {
        Factory = _Factory;
        WETH = _WETH;
        USDT = _USDT;

        USDTPool = PoolAddress.computeAddress(_Factory, PoolAddress.getPoolKey(_WETH, _USDT, 3000));
    }

    function enableAssetPool(address _asset, uint24 _fee) external onlyOwner {
        address pool = PoolAddress.computeAddress(Factory, PoolAddress.getPoolKey(WETH, _asset, _fee));
        assetToPool[_asset] = pool;
    }

    function getUsdPrice1e18(address asset) public override view returns (uint) {
        uint256 returnAmount;

        if (asset == WETH) {
            address[] memory route = new address[](2);
            route[0] = WETH;
            route[1] = USDT;

            IUniswapV3Pool[] memory pools = new IUniswapV3Pool[](1);
            pools[0] = IUniswapV3Pool(USDTPool);

            (returnAmount,) = getExpectedReturnAmount(route, pools, 1e18);
        } else {
            address[] memory route = new address[](3);
            route[0] = asset;
            route[1] = WETH;
            route[2] = USDT;

            IUniswapV3Pool[] memory pools = new IUniswapV3Pool[](2);
            pools[0] = IUniswapV3Pool(assetToPool[asset]);
            pools[1] = IUniswapV3Pool(USDTPool);

            (returnAmount,) = getExpectedReturnAmount(route, pools, 1e18);
        }

        return returnAmount * 1e12;
    }
